package main

import "math"

// GreatestCommonDivisor returns the greatest common divisor of two integers a and b.
// It uses the Euclidean algorithm. The result is always non-negative,
// consistent with the standard mathematical definition of GCD.
func GreatestCommonDivisor(a int, b int) int {
	// Take absolute values of a and b to ensure the GCD is always non-negative,
	// as per the standard mathematical definition.
	// math.Abs operates on float64, so type conversions are necessary.
	a_abs := int(math.Abs(float64(a)))
	b_abs := int(math.Abs(float64(b)))

	// Euclidean algorithm (iterative)
	for b_abs != 0 {
		a_abs, b_abs = b_abs, a_abs%b_abs
	}
	return a_abs
}
